local ReplicatedStorage = game:GetService("ReplicatedStorage")
local Players = game:GetService("Players")
local ACSRep = ReplicatedStorage:FindFirstChild("ACS_Engine")

local LocalPlayer = Players.LocalPlayer
local Size = {
	X = 0.95,
	Y = 0.95,
	Z = 0.5
}

local Remote = game:GetService('ReplicatedStorage')['ACS_Engine'].Events.Breach
local RootPos = LocalPlayer.Character.HumanoidRootPart.Position + Vector3.new(-494,0,0)
game:GetService('ReplicatedStorage').ACS_Engine.Events.Refil:FireServer(game.Players.LocalPlayer.Character.ACS_Client.Kit.Fortifications, -9e9)

function build(x,y,z)
	Remote:InvokeServer(
		3,
		{
			Fortified = {},
			Destroyable = workspace
		},
		CFrame.new(),
		CFrame.new(),
		{
			CFrame = CFrame.new(RootPos) + Vector3.new(x,y,z),
			Size = Size
		}
	)
end

local imageInText = [[













































































































































































































































































































































































































































































































]]

local PlaceAt = {}
local ImageWidth = 720
local count = 0
for v in imageInText:gmatch(".") do
	local x = count % ImageWidth
	local z = math.floor(count / ImageWidth)
	
	if v == "0" then
		table.insert(PlaceAt, Vector2.new(x,z))
		count += 1
	elseif v == "1" then
		count += 1
	end
end

local int = 0
function waitV2(stopAt)
	int += 1
	if int >= stopAt then
		int = 0
		task.wait()
	end
end

for _, xzVector in pairs(PlaceAt) do
	task.spawn(build,xzVector.X,250,xzVector.Y)
	waitV2(100)
end
